import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes";

function App(){
    return(
    <div>    
    <Header />
    <Note title={notes.content} />
    <Footer />
    </div>
    )
}

export default App;
